dialect:
  MYSQL5InnoDBDialect: ''
spring:
  h2:
    console:
      enabled: 'true'
  jpa:
    show_sql: 'true'
  session:
    store-type: jdbc
  profiles:
    include: oauth,private
  servlet:
    multipart:
      max-file-size: 30MB
      max-request-size: 30MB
server:
  port: '9001'
logging:
  level:
    root: info